import React from "react";
import { BrowserRouter, Routes, Route, Link, useLocation, Navigate } from "react-router-dom";
import { AppBar, Toolbar, Button, Container, Alert } from "@mui/material";
import { GoogleOAuthProvider } from "@react-oauth/google";

import HomePage from "./pages/HomePage";
import OrderPage from "./pages/OrderPage";
import LoginPage from "./pages/LoginPage";
import SignupPage from "./pages/SignupPage";
import MerchantSignup from "./pages/MerchantSignup";
import AggregatorSignup from "./pages/AggregatorSignup";
import UserDashboard from "./pages/UserDashboard";
import PaymentSelection from "./components/PaymentSelection";

// Only inject basic white background for /dashboard, let your dashboard component handle all design
function DashboardCSSWrapper({ children }) {
  const location = useLocation();
  React.useEffect(() => {
    let styleElem = null;
    if (location.pathname === "/dashboard") {
      styleElem = document.createElement("style");
      styleElem.innerHTML = `
        body, html, #root {
          background: #f7f9fa !important;
          min-height: 100vh;
        }
      `;
      document.head.appendChild(styleElem);
    }
    return () => {
      if (styleElem) document.head.removeChild(styleElem);
    };
  }, [location]);
  return children;
}

// Protected route for dashboard
function ProtectedRoute({ children }) {
  // You can use a better logic here (token, context, etc.), for now basic localStorage
  const isLoggedIn = localStorage.getItem("isLoggedIn") === "true"; 
  const [showWarning, setShowWarning] = React.useState(false);

  React.useEffect(() => {
    if (!isLoggedIn) setShowWarning(true);
  }, [isLoggedIn]);

  if (!isLoggedIn) {
    return (
      <>
        {showWarning && (
          <Alert severity="warning" sx={{ mt: 4, mb: 2, mx: "auto", maxWidth: 400 }}>
            Please login to access the dashboard.
          </Alert>
        )}
        <Navigate to="/login" />
      </>
    );
  }

  return children;
}

// Navbar with only Home button
function MainAppBar() {
  return (
    <AppBar position="static" color="default" elevation={1} sx={{ mb: 0, bgcolor: "#fff" }}>
      <Toolbar>
        <Button component={Link} to="/" color="inherit">
          Home
        </Button>
      </Toolbar>
    </AppBar>
  );
}

function App() {
  return (
    <GoogleOAuthProvider clientId="565209562551-8kl75442g9j39u158hpa7j8ns3rrkbma.apps.googleusercontent.com">
      <BrowserRouter>
        <DashboardCSSWrapper>
          <Routes>
            <Route
              path="/dashboard"
              element={
                <ProtectedRoute>
                  <UserDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="*"
              element={
                <>
                  <MainAppBar />
                  <Container maxWidth="md" sx={{ mt: 4 }}>
                    <Routes>
                      <Route path="/" element={<HomePage />} />
                      <Route path="/order" element={<OrderPage />} />
                      <Route path="/login" element={<LoginPage />} />
                      <Route path="/signup" element={<SignupPage />} />
                      <Route path="/merchant-signup" element={<MerchantSignup />} />
                      <Route path="/aggregator-signup" element={<AggregatorSignup />} />
                      <Route path="/payment" element={<PaymentSelection />} />
                      {/* OrderHistory route removed */}
                    </Routes>
                  </Container>
                </>
              }
            />
          </Routes>
        </DashboardCSSWrapper>
      </BrowserRouter>
    </GoogleOAuthProvider>
  );
}

export default App;
